import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 55.1-2522 Certain property not presumed abandoned in the Commonwealth.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2522.md","filePath":"vacode/55.1-2522.md"}'),r={name:"vacode/55.1-2522.md"},n=o('<h1 id="§-55-1-2522-certain-property-not-presumed-abandoned-in-the-commonwealth" tabindex="-1">§ 55.1-2522 Certain property not presumed abandoned in the Commonwealth. <a class="header-anchor" href="#§-55-1-2522-certain-property-not-presumed-abandoned-in-the-commonwealth" aria-label="Permalink to &quot;§ 55.1-2522 Certain property not presumed abandoned in the Commonwealth.&quot;">​</a></h1><p>If specific property that is subject to the provisions of §§ <a href="/vacode/55.1-2501/">55.1-2501</a>, <a href="/vacode/55.1-2503/">55.1-2503</a>, <a href="/vacode/55.1-2507/">55.1-2507</a>, <a href="/vacode/55.1-2511/">55.1-2511</a>, <a href="/vacode/55.1-2513/">55.1-2513</a>, <a href="/vacode/55.1-2514/">55.1-2514</a>, <a href="/vacode/55.1-2520/">55.1-2520</a>, and <a href="/vacode/55.1-2521/">55.1-2521</a> is payable to an owner whose last known address is in another state by a holder that is subject to the jurisdiction of that state, the specific property is not presumed abandoned in the Commonwealth and subject to this chapter if:</p><ol><li><p>It may be claimed as abandoned or escheated under the laws of such other state; and</p></li><li><p>The laws of such other state make reciprocal provision that similar specific property is not presumed abandoned or escheatable by such other state when payable to an owner whose last known address is within the Commonwealth by a holder that is subject to the jurisdiction of the Commonwealth.</p></li></ol><p>1960, c. 330, § 55-210.11; 1981, c. 47; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0733" target="_blank" rel="noreferrer">733</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0745" target="_blank" rel="noreferrer">745</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',4),i=[n];function s(h,c,d,p,l,m){return a(),t("div",null,i)}const b=e(r,[["render",s]]);export{_ as __pageData,b as default};
